const AirVolConsommation = () => {
  <SafeAreaView style={styles.container}>
    <ScrollView contentContainerStyle={styles.scrollContainer}>
      <Text>Page Air plong√© simple</Text>
    </ScrollView>
  </SafeAreaView>;
};

export default AirVolConsommation;
